(8, 1, '2023-06-08 12:25:33', '2023-06-08 09:25:33', '[text* your-name placeholder\"Ваше имя\"]\r\n\r\n[tel* your-phone placeholder\"Ваш телефон\"]\r\n\r\n[submit \"Записаться на прием\"]\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <info@dental-tooth.ru>\nuverstki@gmail.com\nОт: [your-name]\r\nТема: Новая заявка с сайта Dental Tooth\r\n\r\nСообщение:\r\nИмя: [your-name]\r\nТелефон: [your-phone]\r\n\r\n-- \r\nЭто сообщение отправлено с сайта dental-tooth.ru\nReply-To: [uverstki.ru]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@dental-tooth>\n[your-email]\nСообщение:\r\n[your-message]\r\n\r\n-- \r\nЭто сообщение отправлено с сайта [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nСпасибо за Ваше сообщение. Оно успешно отправлено.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nОдно или несколько полей содержат ошибочные данные. Пожалуйста, проверьте их и попробуйте ещё раз.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nВы должны принять условия и положения перед отправкой вашего сообщения.\nВажно заполнить это поле.\nВ это поле вставлен слишком большой объем данных.\nВ это поле вставлен слишком малый объем данных.\nПри загрузке файла произошла неизвестная ошибка.\nВам не разрешено загружать файлы этого типа.\nЗагруженный файл слишком большой.\nПри загрузке файла произошла ошибка.\nВведите дату в формате ГГГГ-ММ-ДД.\nВ это поле введена слишком ранняя дата.\nВ это поле введена слишком поздняя дата.\nВведите число.\nВ это поле введено слишком маленькое число.\nВ это поле введено слишком большое число.\nНеверный ответ на проверочный вопрос.\nВведите адрес электронной почты.\nВведите URL.\nВведите номер телефона.', 'Записаться на консультацию', '', 'publish', 'closed', 'closed', '', 'kontaktnaya-forma-1', '', '', '2023-06-11 15:50:45', '2023-06-11 12:50:45', '', 0, 'http://dental-tooth/?post_type=wpcf7_contact_form&#038;p=8', 0, 'wpcf7_contact_form', '', 0),
