(122, 1, '2023-06-09 16:22:03', '2023-06-09 13:22:03', 'Для того, чтобы вы могли видеть, откуда все это рожденное заблуждение тех, кто обвиняет удовольствие и восхваляет страдание, я раскрою все дело и объясню то самое, что было сказано этим открывателем истины и как бы архитектором истины. счастливая жизнь. Ибо никто не презирает, не ненавидит и не бежит от удовольствия не потому, что оно есть удовольствие, а потому, что великие страдания причиняют тому, кто не умеет разумно следовать за удовольствием.\r\n\r\nКроме того, нет никого, кто, потому что он любит боль, преследует ее, хочет ее получить, а потому, что никогда не бывает таких времен, когда он ищет большого удовольствия через труд и боль. Ибо, говоря в мельчайших подробностях, кто из нас предпринимает какие-либо физические упражнения, требующие труда, кроме как для того, чтобы извлечь из них какую-либо пользу? Но кто может справедливо критиковать того, кто хочет быть в удовольствии, которое не приносит дискомфорта, или того, кто избегает той боли, которая не приносит удовольствия?»\r\n<h5>Как быть?</h5>\r\nНо на самом деле мы и обвиняем, и низвергаем тех, кто достоин справедливой ненависти, кто смягчился лестью сиюминутных удовольствий, кто какими скорбями и какими бедами испорчен.\r\n<h5>Что с этим делать?</h5>\r\nНо на самом деле мы и обвиняем их, и справедливой ненавистью приводим тех, кто этого заслуживает, и обращаем их в бегство.\r\nТех, кто размягчен и развращен лестью сиюминутных удовольствий, тех, кто исполнен печалей.\r\nРавным образом виновны и те, которые оставляют свои обязанности из-за слабости ума, то есть трудов и болей.\r\nИбо в свободное время, когда мы свободны в выборе, ничто не мешает нам ни в малейшей степени.\r\nС другой стороны, мы осуждаем с праведным негодованием и неприязнью к людям, которые настолько обольщены и деморализованы прелестями сиюминутного удовольствия, настолько ослеплены желанием, что не могут предвидеть страданий и бед, которые неизбежно последуют за ними; и в равной степени виноваты те, кто не выполняет свой долг.', 'Что стоматолог может сделать для ваших зубов', '', 'publish', 'open', 'open', '', 'chto-stomatolog-mozhet-sdelat-dlya-vashi', '', '', '2023-06-10 08:05:44', '2023-06-10 05:05:44', '', 0, 'http://dental-tooth/?p=122', 0, 'post', '', 0),
